### JavaScript

```javascript
"use strict";

function f_gold(text, brokenLetters) {
    let letters = new Set(brokenLetters);
    let res = 0;
    for (let word of text.split(" ")) {
        let find = false;
        for (let letter of letters) {
            if (word.includes(letter)) {
                find = true;
                break;
            }
        }
        if (!find) {
            res += 1;
        }
    }
    return res;
}
```
